def generate_beautiful_set(n):
    low = n / 3
    high = 2 * n // 3
    cardinality = high + 1
    beautiful_set = []
    for i in range(low + 1):
        beautiful_set.append((i, 2 * (low - i), n + i - 2 * low))
    for j in range(low + 1, high + 1):
        beautiful_set.append((j, 2 * (high - j) + 1, n + j - 1 - 2 * high))
    return (cardinality, beautiful_set)

